import { useEffect, useState } from "react";
import axios from 'axios';

const Quotes = () => {

    const [quotes, setQuotes] = useState([]);

    const getQuotes = () => {
        axios.get('https://type.fit/api/quotes', {
            mode: "cors"
        })
            .then((res) => {
                setQuotes(res.data);
                console.log(res.data);

            })
            .catch((error) => {
                console.error(error);
            })

    }
    useEffect(() => {
        getQuotes()
      }, []);
      const sort = quotes.sort((a, b) => a.id - b.id)
      

    return (
        <div className="quotes">
            <h2>Quotes</h2>
           
                <ul className="quotes">
                   {quotes.sort()}
                    {quotes.map((quotes) => {
                        return (
                            <li key={quotes.id}>
                                <span>{quotes.author}</span>
                                <br></br>
                                <span>{quotes.text} </span>
                            </li>
                        )

                    })}
                </ul>
        
        </div>
    )
}

export default Quotes;
